import React, { useEffect, useState } from 'react';
import axios from 'axios';

function ObszarList() {
  const [obszars, setObszars] = useState([]);

  useEffect(() => {
    axios.get('/api/obszary')
      .then(response => setObszars(response.data))
      .catch(error => console.error('Error fetching obszars', error));
  }, []);

  return (
    <div className="container mt-3">
      <h1 className="mb-3">List of Areas</h1>
      <ul className="list-group">
        {obszars.map(obszar => (
          <li key={obszar.id} className="list-group-item">
            {obszar.nazwa} - {obszar.serwisantNazwisko}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ObszarList;
